import React from 'react';

function Input({ value, handlePlayerNameChange, teamColor, playerNumber, placeholder }) {

    return (
        <input
            type='text'
            value={value}
            onChange={(e) =>
                handlePlayerNameChange('teams', teamColor, playerNumber, e.target.value)
            }
            placeholder={placeholder}
            style={{
                width: '300px',
                padding: '5px',
                borderLeft: 'none',
                borderRight: 'none',
                borderTop: 'none',
            }}
        />
    );
}

export default Input;
